import styled from 'styled-components';

export const NavBar = styled.nav`
  height: 72px;
  width: 100%;
  margin: 0 140px;
  display: flex;
  align-items: center;
  justify-content: space-between;

  .navbar_items {
    display: flex;
    align-items: center;
    justify-content: center;
  }
`;
